package com.burra.practice.blind75

/**
 * Given two strings s and t of lengths m and n respectively, return the minimum window substring of s such that every
 * character in t (including duplicates) is included in the window. If there is no such substring, return the empty
 * string "".

The testcases will be generated such that the answer is unique.

A substring is a contiguous sequence of characters within the string.



Example 1:

Input: s = "ADOBECODEBANC", t = "ABC"
Output: "BANC"
Explanation: The minimum window substring "BANC" includes 'A', 'B', and 'C' from string t.
Example 2:

Input: s = "a", t = "a"
Output: "a"
Explanation: The entire string s is the minimum window.
Example 3:

Input: s = "a", t = "aa"
Output: ""
Explanation: Both 'a's from t must be included in the window.
Since the largest window of s only has one 'a', return empty string.


Constraints:

m == s.length
n == t.length
1 <= m, n <= 105
s and t consist of uppercase and lowercase English letters.
 */
class MinimumWindowSubstring {
    // correct solution but time out exception.
    fun minWindow(s: String, t: String): String {
        var left = 0
        var right = 0
        var result = "$s-1"
        val tMap = HashMap<Char, Int>()
        t.forEach { tMap[it] = tMap.getOrDefault(it, 0) + 1 }
        while (left < s.length && right <= s.length) {
            while (right < s.length && !subStr(s.substring(left, right), tMap)) {
                right++
            }
            val tempString = s.substring(left, right)
            if (subStr(tempString, tMap) && result.length > (right - left - 1)) {
                result = tempString
            }
            left++
        }

        return if (result == "$s-1") "" else result
    }

    private fun subStr(s: String, tMap: Map<Char, Int>): Boolean {
        val sMap = HashMap<Char, Int>()
        s.forEach { sMap[it] = sMap.getOrDefault(it, 0) + 1 }

        for (i in tMap.keys) {
            if (tMap.getOrDefault(i, 0) > sMap.getOrDefault(i, 0))
                return false
        }
        return true
    }
}

fun main() {
    val min = MinimumWindowSubstring()
    println(min.minWindow("ADOBECODEBANC", "ABC"))
    println(min.minWindow("a", "aa"))
    println(min.minWindow("a", "a"))
    println(
        min.minWindow(
            "",
            ""
        )
    )
}